const canvas1 = document.getElementById("canvas1");
const ctx1 = canvas1.getContext("2d");

const image1 = new Image();
image1.src =
  "data:image/png;base64,";

const inputSlider = document.getElementById("resolution");
const inputLabel = document.getElementById("resolutionLabel");
inputSlider.addEventListener("change", handleSlider);

class Cell {
  constructor(x, y, symbol, color) {
    this.x = x;
    this.y = y;
    this.symbol = symbol;
    this.color = color;
  }
  draw(ctx1) {
    ctx1.fillStyle = "teal";
    ctx1.fillText(this.symbol, this.x + 0.5, this.y + 0.5);
    ctx1.fillStyle = this.color;
    ctx1.fillText(this.symbol, this.x, this.y);
  }
}

class AsciiEffect {
  #imageCellArray = [];
  #pixels = [];
  #ctx1;
  #width;
  #height;

  constructor(ctx1, width, height) {
    this.#ctx1 = ctx1;
    this.#width = width;
    this.#height = height;
    this.#ctx1.drawImage(image1, 0, 0, this.#width, this.#height);
    this.#pixels = this.#ctx1.getImageData(0, 0, this.#width, this.#height);
    // console.log(this.#pixels.data);
  }
  #convertToSymbol(g) {
    if (g > 250) return "@";
    else if (g > 240) return "*";
    else if (g > 220) return "+";
    else if (g > 200) return "#";
    else if (g > 180) return "&";
    else if (g > 160) return "%";
    else if (g > 140) return "_";
    else if (g > 120) return "=";
    else if (g > 100) return ".";
    else if (g > 80) return "/";
    else if (g > 60) return ":";
    else if (g > 40) return ",";
    else if (g > 20) return "~";
    else if (g > 10) return "^";
    else return "";
  }
  #scanImage(cellSize) {
    this.#imageCellArray = [];
    for (let y = 0; y < this.#pixels.height; y += cellSize) {
      for (let x = 0; x < this.#pixels.width; x += cellSize) {
        const posX = x * 4;
        const posY = y * 4;
        const pos = posY * this.#pixels.width + posX;

        if (this.#pixels.data[pos + 3] > 128) {
          const red = this.#pixels.data[pos];
          const green = this.#pixels.data[pos + 1];
          const blue = this.#pixels.data[pos + 2];
          const total = red + green + blue;
          const averageColorValue = total / 2;
          const color = "rgb(" + red + "," + green + "," + blue + ")";
          const symbol = this.#convertToSymbol(averageColorValue);
          if (total > 180)
            this.#imageCellArray.push(new Cell(x, y, symbol, color));
        }
      }
    }
    console.log(this.#imageCellArray);
  }
  #drawAscii() {
    this.#ctx1.clearRect(0, 0, this.#width, this.#height);
    for (let i = 0; i < this.#imageCellArray.length; i++) {
      this.#imageCellArray[i].draw(this.#ctx1);
    }
  }
  draw(cellSize) {
    this.#scanImage(cellSize);
    this.#drawAscii();
  }
}

let effect;

function handleSlider() {
  if (inputSlider.value == 1) {
    inputLabel.innerHTML = "Original Bild";
    ctx1.drawImage(image1, 0, 0, canvas1.width, canvas1.height);
  } else {
    inputLabel.innerHTML = "Auflösung: " + inputSlider.value + "px";
    ctx1.font = parseInt(inputSlider.value) * 1.1 + "px Verdana";
    effect.draw(parseInt(inputSlider.value));
  }
}
image1.onload = function initialize() {
  canvas1.width = image1.width;
  canvas1.height = image1.height;
  effect = new AsciiEffect(ctx1, image1.width, image1.height);
  handleSlider();
};
